import { Box } from "@chakra-ui/react";

function HomePage() {
    return(
        <Box margin="10px" bgGradient='linear(red.100 0%, orange.100 25%, yellow.100 50%)'>
            <p>Home</p>
        </Box>
    );
}

export default HomePage;
